import React from 'react';

import './Records.css';

const Records = () => {
    return (
        <div className="records">
            <div className="records__card">
                <span>24.05.2021.</span>
                <select>
                    <option>Od kuce</option>
                    <option>Iz kancelarije</option>
                    <option>Odsutan</option>
                </select>
                <textarea placeholder="Obrazlozite razlog odsustva"></textarea>
            </div>
        </div>
    )
}

export default Records
